import React from "react";
import SingleBook from "./SingleBook";

const Shelf = ({test: shelfBooks, updateShelf}) => {
  return (
    <ol className="books-grid">
      {test.map((book) => (
        <SingleBook
          key={book.id}
          book={book}
          updateShelf={updateShelf}
        />
      ))}
    </ol>
  );
};

export default Shelf;
